#.each do를 통해 레코드를 모두 0으로 초기화 한다
roominfo = Roomseed.all
roominfo.each do |r|
    
    #switch case 이용하여 건물 이름 넣어줌
    case r.roomnumber.first(2)
    when '20'
        bd = "법학관"
    when '2B'
        bd = "법학관"
    when '31'
        bd = "인문관"
    when '32'
        bd = "경제관"
    when '33'
        bd = "경영관"
    when '50'
        bd = "호암관"        
    when '61'
        bd = "수선관"
    when '62'
        bd = "수선관"
    when '90'
        bd = "국제관"        
    when '9B'
        bd = "국제관"     
    else
        bd = "오류"
    end
    
    
    #while문 두 번을 통해 한 강의실당 5개*26개(?)의 레코드를 생성함
    #비어있는 상태를 1이라 하자!
    weekvalue = 1
    while weekvalue < 6
    
        timevalue = 900
        while timevalue < 2200 
            Roominfo.create(roomnumber: r.roomnumber, bulidingname: bd, weekday: weekvalue, timevalue: timevalue, isempty: 1)
            timevalue = timevalue + 50
        end
        
        weekvalue = weekvalue + 1
    end
end #초기화 종료.
=end


